import React from 'react';
import './Contact.css';

function Contact(props) {
    let contacts = props.contacts;

    // onMouseEnter

    // onMouseLeave
    const listItems = contacts.map((c) =>
        <p><a href={c.url}>{c.method}</a></p>
    );

    return (
        <div class="contact">
            <div class="contact_links">
                {listItems}
            </div>
        </div>
    );
}

export default Contact;
